import React from 'react';
import './RegistrationPage.scss';


const RegistrationPage = () => {
    return (
        <div>
            {/*Probably the location of a header or maybe a nav componenent */}
            <form
                className=""
            >
                <label 
                    className="" 
                    htmlFor="username">
                        UserName: 
                </label>
                <input 
                    type="text" 
                    className="" 
                    name="username"
                    placeholder="Enter username here"
                />
            </form>
        </div>
    );
};

export default RegistrationPage;
